import axios from "axios";

function getAllUsers() {
	axios.get('http://localhost')
  .then(function (response) {
    // handle success
    console.log(response);
  })
  .catch(function (error) {
    // handle error
    console.log(error);
  })
  .finally(function () {
    // always executed
  });
}

const App:React.FC = () =>
{
	getAllUsers();
	return (
		<div> 
			<h1>These are all the Users!</h1>
		</div>
		);
}

export default App;
